import React from 'react';
import styled from 'styled-components';
import Title from '../Title';
import Link from '../../Link';
import Button from '../Button';


const Container = styled.div`
    width: 1903px;
    position: relative;
    top: -181px;
    background: #fff;
    h1{
        font-size: 30px;
        font-weight: 300;
        line-height: 18px;
    }
    h1:first-child{
        color: #6772e5;
    }

`
const InContainer = styled.div`
    width: 1903px;
    height: 400px;
    background: #fff;
    position: relative;
    top: 49px;
    display: flex;
    justify-content: center;
    align-items: center;


`
const TitleBox = styled.div`
    margin-right: 50px;
`
const ButtonBox = styled.div`
    display: flex;
    width: 500px;
    justify-content: flex-start;
    align-items: center;

    a{
        width: auto;
        margin: 10px;
        padding: 14px;
        font-size: 15px;
        border-radius: 4px;
        box-shadow: 0 4px 6px rgba(50,50,93,.11), 0 1px 3px rgba(0,0,0,.08);
        font-weight: 800;
    }
`
const ItemBlue = styled.a`
  background: #6772E5;;
  color: #FFF;
`

const ItemWhite = styled.a`
  background: #FFF;
  color: #6772E5;

`


class ReadyToStart extends React.Component {
  render(){
    return (
        <Container>

            <InContainer>
                <TitleBox>
                    <Title title="Ready to get started?"/>
                    <Title title="Get in touch or create an account."/>
                </TitleBox>
                <Button btn3="CREATE STRIPE ACCOUNT" btn2="CONTACT SALES"/>
            </InContainer>



        </Container>


    );
  }
}
export default ReadyToStart;
